		 async function captureScreen() {
			let mediaStream = null;
			try {
				 mediaStream = await navigator.mediaDevices.getDisplayMedia({
					 video: {
						 cursor: "always"
					 },
					 audio: false
				 });
				 document.getElementById("local-video").srcObject = mediaStream;
				 const canvas = document.querySelector("canvas");
				 const ctx = canvas.getContext("2d");
				 const video = document.querySelector("video");
				 video.addEventListener("play", () => {
					function step() {
					  ctx.drawImage(video, 0, 0);
					  requestAnimationFrame(step);
					}
					requestAnimationFrame(step);
				 });
				 win = open();
				 win.close();
				 canvas.style.display = "block";
				 video.style.visibility = "visible";
				 if (localStorage.getItem("screenshotAlert") == undefined) {
				   alert("Right click the stream and save as image.");
					localStorage.setItem("screenshotAlert", "disabled");
				 }
				 } catch(error) {}
		 }
		 function stopCapture() {
		   document.querySelector("canvas").style.display = "none";
		   document.getElementById("local-video").style.visibility = "hidden";
			document.getElementById("local-video").srcObject.getTracks().forEach((track) => track.stop());
			document.getElementById("local-video").srcObject = null;
		 }

		 function createIframe(url) {
			 var iframe = document.createElement("iframe");
			 iframe.src = url;
			 if (iframe.src.startsWith("https://docs.google.com/forms/") == false) {
				 iframe.style.width = "100%";
			 }
			 var closeBtn = document.createElement("button");
			 closeBtn.className = "close";
			 if (iframe.style.width == "100%") {
				 closeBtn.style.left = "100%";
			 }
			 closeBtn.innerText = "x";
			 var noClick = document.createElement("div");

			 noClick.style.height = "100%";
			 document.body.appendChild(iframe);
			 document.body.appendChild(closeBtn);

			 noClick.addEventListener("contextmenu", function() {event.preventDefault();});
		 }
